import React from "react";
import { useSelector } from "react-redux";
const DataPage = () => {
  const x = useSelector((item) => {
    return item.loginAddreducer;
  });
  return (
    <>
      <div>
        <h1>You have selected the users data</h1>
        <ul>
          {x.add.map(({ id, name, email }) => {
            return (
              <li key={id}>
                <h2>userId : {name}</h2>
                <h4>title : {email}</h4>
              </li>
            );
          })}
        </ul>
      </div>
    </>
  );
};
export default DataPage;
